import '../App.css'
import React from 'react';

const Users = () => {

    return (
        <div className="users">
            <ul>
                <li><a className="active" href="#home">Home</a></li>
                <li><a href="#news">News</a></li>
                <li><a href="#contact">Contact</a></li>
                <li><a href="#about">About</a></li>
            </ul>
            <div className="centered">
                <p>Users</p>
            </div>
        </div>
    );
}

export default Users;
